import React from 'react';
import redGif from 'https://media4.giphy.com/media/xT0GqimU9dTwmE5lra/giphy.gif?cid=ecf05e47gg1ifib1yjm0w49ooe67adne1obk1khe5zkbd9a7&rid=giphy.gif&ct=g';


const RedGif = () => {
  return (
    <div className="red-gif-container">
      <img src={redGif} alt="Red GIF" className="red-gif" />
    </div>
  );
};

export default RedGif;
